import React from "react";
import ReactDOM from "react-dom/client";

import App from "./App";
import { Route } from 'react-router-dom';

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(

  <Route>
    <React.StrictMode>
      <App />
    </React.StrictMode>
  </Route>

);
